const Summary = props => {
  return (
    <section id="summary">
      <h1>Summary</h1>
      <div>Subtotal<span>{props.summary}</span></div>
      <div>Estimated Shipping<span>{props.summary}</span></div>
      <div>Estimated Tax<span>{props.summary}</span></div>
      <div>Subtotal <span>{props.summary}</span></div>

    </section>
  )
}

export default Summary;
